from config import configfrom discord.ext import commandsdef is_owner():    def predicate(ctx):        return ctx.message.author.id == config["owner_ids"]    return commands.check(predicate)def is_admin(ctx):    roles = []    for role1 in ctx.message.author.roles:        roles.append(str(role1))    if "Admins" in roles:        # print("command is admin True")        return True    # print("command is admin False")    return False